import {Navbar, Container} from "react-bootstrap";
import Image from 'react-bootstrap/Image'



//will be imported in the _app component for all pages
//color: 64AB8A
//needs to be made sticky

const navbar = {backgroundColor: "#64AB8A"}
class Footer extends React.Component {
  render() {
    return(
      <div className="fixed-bottom">  
      <Navbar style={navbar}>
          <Container>
              <div style={{display: 'flex', justifyContent: 'center'}}>
                <div class = "pr-4">
                  <Link to="https://www.instagram.com/hack4impactcalpoly/">
                  <Image src="./images/github.png" width = "30" height = "30"/>
                  </Link>
                </div>
                <div class = "pb-1">
                  <Image src="./images/fb.png" width = "30" height = "30"/>
                  </div>
                  <div class = "pl-4">
                  <Image src="./images/insta.png" width = "30" height = "30"/>
                  </div>
                </div>
              <div style={{display: 'flex', justifyContent: 'center'}}>
                <div>
                  <Image src="./images/H4I_green.png" width = "205" height = "70"/>
                </div>
              </div>

          </Container>
      </Navbar>
      </div>
  )
  }
}

export default Footer;
